import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
const { URLShortener } = require('./components/URLShortener');

function App() {
  return (
    <BrowserRouter>
      <div id="App">
        <h1>Front-End to interact with Microservices</h1>
        <Switch>
          <Route path="/">
            <URLShortener className="App-section"/>
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
